    getUrl: function (svg, color, width, height) {
        try {
            svg = svg.replace(new RegExp("{COLOR}", "g"), color);
            svg = svg.replace(new RegExp("{WIDTH}", "g"), width);
            svg = svg.replace(new RegExp("{HEIGHT}", "g"), height);
            return "url(data:image/svg+xml;base64," + window.btoa(svg) + ")";
        } catch (e) {
            console.log(e);
            return "url()";
        }
    },
    getImage: function (svg, color, width, height) {
        try {
            svg = svg.replace(new RegExp("{COLOR}", "g"), color);
            svg = svg.replace(new RegExp("{WIDTH}", "g"), width);
            svg = svg.replace(new RegExp("{HEIGHT}", "g"), height);
            let img = document.createElement("img");
            img.type = "img";
            img.loading = "eager";
            img.src = "data:image/svg+xml;base64," + window.btoa(svg);
            img.style.width = width;
            img.style.height = height;
            return img;
        } catch (e) {
            console.log(e);
            return null;
        }
    },
    getHelp: function (svg, dom, key, parent, color, width, height) {
        try {
            svg = svg.replace(new RegExp("{COLOR}", "g"), color);
            svg = svg.replace(new RegExp("{WIDTH}", "g"), width);
            svg = svg.replace(new RegExp("{HEIGHT}", "g"), height);
            let img = document.createElement("img");
            img.type = "img";
            img.className = "title_close_button";
            img.src = "data:image/svg+xml;base64," + window.btoa(svg);
            img.style.width = width;
            img.style.height = height;
            img.onmouseenter = function () {
                UI.help(dom, key, parent);
            };
            return img;
        } catch (e) {
            console.log(e);
            return null;
        }
    },
    getSrc: function (svg, color, width, height) {
        try {
            svg = svg.replace(new RegExp("{COLOR}", "g"), color);
            svg = svg.replace(new RegExp("{WIDTH}", "g"), width);
            svg = svg.replace(new RegExp("{HEIGHT}", "g"), height);
            return "data:image/svg+xml;base64," + window.btoa(svg);
        } catch (e) {
            console.log(e);
            return "";
        }
    }
